import React from "react";
import Button from '@material-ui/core/Button';

const styles = {
    btnCss: {
     margin:"4% 0 0 4%",
     borderRadius:"5px"
    },
}


class Home extends React.Component {
    constructor(props) {
      super(props);
      this.state = {}
    }

    randomImage=()=> {
        var fileNames = [
            "image1.png",
            "image2.jpg",
            "image3.png"
          ],
          randomIndex = Math.floor(Math.random() * fileNames.length),
          backgroundImage = 'url(' + fileNames[randomIndex] + ')';

        document.getElementById('background').style.backgroundImage = backgroundImage;
      }


    render() {
        return (
            <div>

<Button variant="contained" size="medium" color="primary" style={styles.btnCss} 
onClick={() => this.randomImg} >
          Start
        </Button>
            </div>
        )

        }
}
export default Home;
